import { AcceptBooking } from "./AcceptBooking.js"
import { DenyBooking } from "./DenyBooking.js"

export const BookingStatus = ({requests}) => {


    const statusUpdate = () => {
        if(requests.isAccepted) {
            return "ACCEPTED"
        } else if(requests.isAccepted) {
            return "DENIED"
        } else { 
            return "" 
        }
    }

    console.log(statusUpdate())
    return (
        <>
        {requests.isAccepted ?
            <AcceptBooking requests={requests} /> :
            <DenyBooking requests={requests} />
        }
        </>
    )
}
